import {Col} from "react-bootstrap";

const Item = (props) => {
    return (
        <Col >
            <img src={props.data.url} width="80%" />
            <h4>{props.data.title}</h4>
            <p>{props.data.content}</p>
            <p>가격:  {props.data.price}</p>
        </Col>
    )
}

export default Item;
